import './App.css';
import React from 'react';
import Register from './Register';
import {Login,Home} from './Login';
import Navbar from './Navbar';
import {Switch,Route,Router} from 'react-dom';

function App() {
  return (
    <div>
      <Navbar/>
      <Switch>
        <Route><Home/></Route>
        <Route><Login/></Route>
        <Route><Register/></Route>
      </Switch>

    </div>
  ); 
}

export default App;
